import React, { StatelessComponent } from 'react';
import { Container, Row, Col } from 'react-bootstrap'
import Sidebar from '../layout/sidebar'
import Content from './content'

const Main: React.StatelessComponent = () => {
    return(

        <Container fluid>
          <Row>
            <Col sm={2}>
                <Sidebar></Sidebar>
            </Col>
            <Col sm={10}>
                <Content></Content>
            </Col>
          </Row>
        </Container>

    );
};

export default Main;
